%[text] %[text:anchor:T_310E7A54] # Complex-symbol-to-bits Demapping for IQ Modulations
%[text] This functions demaps a complex symbol stream into a bit stream with respect to some QAM constellations using gray coding.
%[text] <u>**Inputs:**</u>
%[text] - *symb\_RX\_estimated*: estimated symbol stream vector of size *nb\_symb x 1*
%[text] - *nb\_bit\_per\_symb*: number of bits per symbol
%[text] - *nb\_symb*: number of symbols in the  symbol stream (= length of *symb\_RX*) \
%[text] <u>**Ouputs:**</u>
%[text] - *bit\_RX*: estimated bit stream vector of size *nb\_bit x 1* where *nb\_bit = nb\_bit\_per\_symb x nb\_symb* \
function bit_RX = demapping_QAM( symb_RX_estimated , nb_bit_per_symb , nb_symb )

nb_bit = nb_symb * nb_bit_per_symb ;                  % Number of bits of the bit stream
bit_RX = zeros( nb_bit , 1 ) ;                        % Bit stream vector initialization
%[text:tableOfContents]{"heading":"**Table of Contents**"}
%[text] %[text:anchor:H_7FDCC6E6] ## 4QAM constellation (\<=\> QPSK)
%[text] The de-mapping for the QPSK constellation should be done as shown below:
%[text] ![](text:image:5ad6)
%[text] This mapping follows a gray coding: each symbol differs from its neighbors by one bit only. This reduces bit errors as a received symbol distorted by some noise is more likely to fall close to an adjacent symbol  than close to a faraway symbol. 
if nb_bit_per_symb == 2
    
    % Code here the demapping function for QPSK constellation with Gray
    % coding (output: bit_RX).
    for k=1:nb_symb
        kb = 2*(k-1)+1;
        
        I = real(symb_RX_estimated(k));
        if (I == 1)
            bit_RX(kb) = 1;
        else
            bit_RX(kb) = 0;
        end

        Q = imag(symb_RX_estimated(k));
        if (Q == 1)
            bit_RX(kb+1) = 1;
        else
            bit_RX(kb+1) = 0;
        end

    end

    
end

%[text] %[text:anchor:H_FD5AD12D] ## 16QAM constellation
%[text] The de-mapping for the 16QAM constellation should be done as shown below:
%[text] ![](text:image:568f)
%[text] This mapping follows a gray coding: each symbol differs from its neighbors by one bit only. This reduces bit errors as a received symbol distorted by some noise is more likely to fall close to an adjacent symbol  than close to a faraway symbol. 
if nb_bit_per_symb == 4
    
    % Code here the demapping function for 16QAM constellation with Gray
    % coding (output: bit_RX)
    for k=1:nb_symb
        kb = 4*(k-1)+1;
        
        I = real(symb_RX_estimated(k));
        if (I == -3)
            bit_RX(kb) = 0;
            bit_RX(kb+1) = 0;  
        elseif (I == -1)
            bit_RX(kb) = 0;
            bit_RX(kb+1) = 1;  
        elseif (I == +1)
            bit_RX(kb) = 1;
            bit_RX(kb+1) = 1; 
        else
            bit_RX(kb) = 1;
            bit_RX(kb+1) = 0; 
        end

        Q = imag(symb_RX_estimated(k));
        if (Q == -3)
            bit_RX(kb+2) = 1;
            bit_RX(kb+3) = 0;  
        elseif (Q == -1)
            bit_RX(kb+2) = 1;
            bit_RX(kb+3) = 1;  
        elseif (Q == +1)
            bit_RX(kb+2) = 0;
            bit_RX(kb+3) = 1; 
        else
            bit_RX(kb+2) = 0;
            bit_RX(kb+3) = 0; 
        end

    end



end

end

